webpackJsonp([0x5d0c90b3619d],{1578:function(a,e){a.exports={data:{markdownRemark:{html:'<p>이른 아침 "문서 및 소설"을 읽는 것은 저자의 경험 또는 자기 개발 경험 인 소설입니다. 나는 아직 끝나지 않았다. 나는 아직 결론을 내릴 수 없다. 그것은 1949 년 이후 중국 사회에 고유 한 문화 현상, 또는 도시 사회 생활에 고유 한 것을 말해줍니다. 인민 해방군이이 도시에 들어서 자 사회에서 두 가지 문화가 형성되었다. 하나는 야난에 주조 된 혁명적 문화 였고, 소설에서는 "동지"문화로, 다른 하나는 도시에 원래 있던 문화였다. "미성년자"문화.</p>\n<p>소설은이 갈등이나 틈으로 시작합니다. 그러나이 두 문화는 실제로 현대 도시에서 잠시 동안 존재 해 왔으며 정치 생활과 심리적 구조뿐만 아니라 사람들의 사회 생활에 헤아릴 수없는 영향을 미쳤습니다. 현대 중국 사회의 사회 발전을 연구하는 것은이 점을 무시할 수 없다. 최근에는 시장 경제와 상품 경제가 발전함에 따라 이러한 문화적 차이가 점점 작아지고 있으며, 상품 문화는 큰 힘을 가지고 있으며 모든 문화적 장벽을 뛰어 넘을 수 있습니다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0025.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0025.md",frontmatter:{title:"2월 5일 토요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0025.md absPath of file >>> MarkdownRemark"}}}});
